#include <stdbool.h>
#include <stdlib.h>
#include <stdio.h>
#include <stdint.h>

#define TIMER_BASE 0xFF202000
#define TIMER_DELAY 300000000 // counts to 3s for each start menu album (300 000 000)

volatile int pixel_buffer_start; // global variable
short int Buffer1[240][512];     // 240 rows, 512 (320 + padding) columns
short int Buffer2[240][512];

// External declarations remain the same
extern short unsigned int startMenu[76800];
extern short unsigned int end_5[8000];
extern short unsigned int gameMenu[76800];
extern short unsigned int bully_px[3600];
extern short unsigned int grad_px[3600];
extern short unsigned int yeezus_px[3600];

// Function Prototypes
void plot_pixel(int x, int y, short int line_color);
void clear_screen();
void wait_for_vsync();
void plot_image_menu(int x, int y);
void plot_image_end(int x, int y, int type);
void plot_album(int x, int y, int albNum);
void erase_album(int x, int y);

int main(void)
{
    // Pointer setup
    volatile int *pixel_ctrl_ptr = (volatile int *)0xFF203020;
    volatile int *timer_base_ptr = (volatile int *)TIMER_BASE;

    // Timer initialization
    *timer_base_ptr = 0x0;  // Clear TO bit
    *(timer_base_ptr + 1) = (int)TIMER_DELAY & 0xFFFF; // Lower 16 bits
    *(timer_base_ptr + 2) = (int)(TIMER_DELAY >> 16) & 0xFFFF; // Upper 16 bits

    unsigned int enable = 0b0110;
    *(timer_base_ptr + 1) = enable;

    int albumCount = 0;
    int lastAlbumCount = -1;  // Track last album to ensure rotation

    // Buffer setup
    *(pixel_ctrl_ptr + 1) = (int)&Buffer1;
    wait_for_vsync();
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen();

    *(pixel_ctrl_ptr + 1) = (int)&Buffer2;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);
    clear_screen();

    // Main animation loop
    while (1)
    {
        wait_for_vsync();
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // New back buffer

        // Always draw menu in each frame
        plot_image_menu(0, 0);

        // Check timer status
        if (*(timer_base_ptr) & 0x1)  // Timeout bit set
        {
            // Rotate through albums with different positioning
            switch(albumCount) {
                case 0:
                    plot_album(0, 0, 1);  // Bully
                    break;
                case 1:
                    plot_album(0, 0, 2);  // Graduation
                    break;
                case 2:
                    plot_album(0, 0, 3);  // Yeezus
                    break;
            }

            // Erase previous album if different
            if (lastAlbumCount != albumCount) {
                erase_album(0, 0);  // Erase from top left
                erase_album(0, 160);  // Erase from bottom left
            }

            // Update album count
            albumCount = (albumCount + 1) % 3;
            lastAlbumCount = albumCount;

            // Clear the timeout bit
            *(timer_base_ptr) = 1;
        }
    }

    // Unreachable, but kept for completeness
    clear_screen();
    plot_image_end(110, 160, 5);

    return 0;
}

void plot_pixel(int x, int y, short int line_color)
{
    // Make sure we're within bounds
    if (x < 0 || x >= 320 || y < 0 || y >= 240)
        return;

    volatile short int *one_pixel_address;
    one_pixel_address = (volatile short int *)(pixel_buffer_start + (y << 10) + (x << 1));
    *one_pixel_address = line_color;
}

void clear_screen()
{
    for (int x = 0; x < 320; x++)
    {
        for (int y = 0; y < 240; y++)
        {
            plot_pixel(x, y, 0x0);
        }
    }
}


void wait_for_vsync()
{
    volatile int *fbuf = (int *)0xFF203020;
    int status;
    *fbuf = 1;
    status = *(fbuf + 3);
    while (status & 1)
    {
        status = *(fbuf + 3);
    }
}

// Function to plot the start menu at position (0,0)
void plot_image_menu(int x, int y)
{
    for (int i = 0; i < 240; i++)
    {
        for (int j = 0; j < 320; j++)
        {
            plot_pixel(x + j, y + i, startMenu[i * 320 + j]);
        }
    }
}

void plot_album(int x, int y, int albNum) {
    for (int i = 0; i < 60; i++) {
        for (int j = 0; j < 60; j++) {
            if(albNum == 1) plot_pixel(x + j, y + i, bully_px[i * 60 + j]);
            else if(albNum == 2) plot_pixel(x + j, y + i, grad_px[i * 60 + j]);
            else if(albNum == 3) plot_pixel(x + j, y + i, yeezus_px[i * 60 + j]);
        }
    }
}

void erase_album(int x, int y) {
    for (int i = 0; i < 60; i++) {
        for (int j = 0; j < 60; j++) {
            plot_pixel(x + j, y + i, 0);
        }
    }
}

void plot_image_end(int x, int y, int type) {
    for (int i = 0; i < 80; i++) {
        for (int j = 0; j < 100; j++) {
            if(type == 5)plot_pixel(x + j, y + i, end_5[i * 100 + j]);
        }
    }
}

